import React from "react";
import { useDispatch } from "react-redux";
import increment from '../actions'

const MyButton = () => {
    let dispatch = useDispatch()
    return (
        <button onClick={() => dispatch(increment(1))}>Increment Counter</button>
    )
}

export default MyButton
